import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/pages/NavBar';
import Home from './components/pages/Home';
import OptionA from './components/pages/OptionA';
import OptionB from './components/pages/OptionB';
import Login from './components/pages/Login';
import Signup from './components/pages/Signup';
import './sass/main.scss';
import Userpage from './components/pages/Userpage';
import { useState } from 'react';


const App = () => {

    const [userData, setUserData] = useState({ email: '', age: 0 });

    const handleSignupSuccess = (email: string, age: number) => {
      setUserData({ email, age });
    };


  return (
    <Router>
      <div>
        <NavBar />
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/option-a" element={<OptionA />} />
          <Route path="/option-b" element={<OptionB />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup onSignupSuccess={handleSignupSuccess} />} />
          <Route path="/userpage" element={<Userpage email={userData.email} age={userData.age} />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
